DROP TABLE IF EXISTS `FC_INNERC_PAYMENT_ACCOUNT_BANK`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `FC_INNERC_PAYMENT_ACCOUNT_BANK` (
  `PAYMENT_BANK_ID` char(38) NOT NULL COMMENT '流水號',
  `PAYMENT_CHANNEL_ID` char(38) DEFAULT NULL,
  `BANK_NAME` varchar(20) DEFAULT NULL COMMENT '銀行名稱',
  `BANK_CODE` varchar(15) DEFAULT NULL COMMENT '银行代码',
  `STATUS` int(11) DEFAULT NULL COMMENT '狀態(1.f啟用0.停用)',
  `MODIFY_TIME` datetime DEFAULT NULL,
  `CREATE_TIME` datetime DEFAULT NULL,
  `BANK_VALUE` varchar(15) DEFAULT NULL COMMENT '銀行值',
  PRIMARY KEY (`PAYMENT_BANK_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='支付渠道所支持的''銀行表';

