CREATE TABLE `FC_INNERC_PAYMENT_BANK_DEPLOY` (
  `DEPLOY_ID` char(38) NOT NULL COMMENT '流水號',
  `BUSINESS_ID` char(64) DEFAULT NULL COMMENT '游戏平台',
  `DEPLOY_CODE` varchar(30) DEFAULT NULL COMMENT '配置代號',
  `DEPLOY_VALUE` varchar(30) DEFAULT NULL COMMENT '配置值',
  `PAYMENT_ID` char(38) DEFAULT NULL,
